function v_owner_card(e,s){e.clear(),e.state.clear();const n=s.card_seq.length;let t=new Array;for(let e=0;e<n;++e)t.push([`<div class="col-xs-12 owner_card_item" data-card_seq="${s.card_seq[e]}">\n<div class="over_wrapper">\n<span class="pull-left">\n${select_state_icon(s.status[e])}\n</span>\n${select_title_sytle(s.is_hidden[e],s.is_deleted[e],s.title[e],s.card_seq[e])}\n</div>\n<div id="status_icons">\n<div class="pull-left">\n<span>\n${select_state_sytle(s.is_hidden[e],s.is_deleted[e])}\n</span>\n<span id="priority">\n${select_priority_icon(s.priority[e],"fa-lg")}\n</span>\n<span id="per_done">${s.per_done[e]}%</span>\n</div>\n<small class="pull-right">${lll_time(s.rtime[e])}</small>\n</div>\n</div>`,s.rtime[e],"card_seq_"+s.card_seq[e]]);e.rows.add(t),e.draw()}